import React, {Component} from "react";
import Router from 'next/router';
import Link from 'next/link';

class Header extends Component {
    render () {
        return (
            <div className="header">
                <h1> MAKEOVER FITNESS</h1>
                <div className="menu">
                    <Link href="/membership"><a> Memberships </a></Link>
                    <p onClick={() => Router.push('/schedule')}> Schedule </p>
                    <p onClick={() => Router.push('/calendar')}> Calendar </p>
                    <p onClick={() => Router.push('/trainers')}> Trainers </p>
                </div>
                <style jsx>{`
                    .header {
                        background-color: #404040;
                        padding-top: 10px;
                        padding-bottom: 15px;
                        text-align: center;
                        font-family: Helvetica;
                        color: white;
                        position: sticky;
                        top: 0;
                    }
                    .header h1 {
                        font-weight: 900;
                        margin-top: 0;
                        margin-bottom: 0;
                        font-size: 100px;
                        display: inline-block;
                    }

                    .header .menu {
                        font-weight: 900;   
                        display: inline-block;
                        padding-left: 200px;
                        text-align: left
                    }

                    .header .menu p {
                        display: inline-block;
                        width: 200px;
                        margin-top: 5px;
                        margin-bottom: 0px;
                    }
                `}</style>
            </div>
        );
    }
}

export default Header;
